'''''Gamil''''' is an unglossed [[Khuzdul]] word, appearing in ''[[Gamil Zirak#Etymology|Gamil Zirak]]''. It is possible that ''gamil'' is related to "old" since Gamil Zirak is also called Zirak the Old, being a similar case to [[Lëa]].{{Fact}}

